import React from 'react';


const Home=()=> {
  return (
    
      <>
      <div className="container-fluid mb-auto">
          <div className="row">
              <div className="col-10 mx-auto">
                  <div className="col-md-6 order-2 order-lg-1">
                      <h1>Welcome to Webi</h1>

                  </div>

              </div>
          </div>
      </div>
       
     
    </>
  );
}

export default Home;
